import { Switch, Link, Route } from "react-router-dom";
import logo from "./logo.svg";
import "./App.css";
import Registration from "./Components/Registration";
import Login from "./Components/Login";

function App() {
  return (
    <div className="App">
      <Header />
      <Switch>
        <Route>
          <Registration />
        </Route>
        <Route>
          <Login />
        </Route>
        <Route></Route>
      </Switch>
      <Footer />
    </div>
  );
}

export default App;
